window.bookSummaryJSON = "<p>While there are plenty of other books out there that explain how to give a spanking or tie a half-hitch, <i>Playing Well With Others</i> is the first book that explains kink culture - the munches, parties, leather bars, conferences, workshops, fetish nights, exploratoriums, and all the other gatherings of kinksters that turn BDSM and leather from a bedroom predilection to a lifestyle and a community.</p> <p>You'll learn to:</p> <p></p> <ul> <li>Examine your own motivations, needs, wants, and desires,</li> <li>Ease your way into established communities,</li> <li>Understand etiquette in different adventurous sex communities,</li> <li>And more...</li> </ul> <p>Contains mature themes.</p>"; 
